import React, { useState, useEffect } from 'react';
import { connect } from 'react-redux';
import { fetchExperimentData } from '../../../model/actions/experiment';
import { getExperimentsData } from '../../../model/selectors/projects';

function Experiment({
    isExperimentDataLoading,
    experimentData,
}) {
    return (
      <p>Experiment here</p>
    );
}

export default connect(state => ({
    experimentData: getExperimentsData(state),
}), dispatch => ({
    fetchExperimentData: () => dispatch(fetchExperimentData()),
}))(Experiment);
